    function tokenURI(uint256 tokenId) override public view returns (string memory) {
        string memory rarity="rare";
        string memory rarityAmount = "X";
        if(releaseDetails[tokenId].lockedAmount < salePrice * 10 ether){
            rarity = "common";
            rarityAmount = "X";
        }else if (releaseDetails[tokenId].lockedAmount < salePrice * 50 ether){
            rarity = "uncommon";
            rarityAmount = "XX";
        }else if (releaseDetails[tokenId].lockedAmount < salePrice * 100 ether){
            rarity = "rare";
            rarityAmount = "XX";
        }else if (releaseDetails[tokenId].lockedAmount < salePrice * 1000 ether){
            rarity = "epic";
            rarityAmount = "XXX";
        }else if (releaseDetails[tokenId].lockedAmount <  salePrice * 10000 ether){
            rarity = "legendary";
            rarityAmount = "XXXX";
        }
        string memory output = getSvgForValue(tokenId);
        string memory json = Base64.encode(bytes(string(abi.encodePacked('{"name": "Time ',tokenId.toString(),'",','"description": "The most valuable thing in the entire world", "image": "data:image/svg+xml;base64,', Base64.encode(bytes(output)), '", "attributes":[{"trait_type":"Rarity","value":"',rarity,'"},{"trait_type":"Rarity Amount","value":"',rarityAmount,'"}]}'))));
        output = string(abi.encodePacked('data:application/json;base64,', json));

        return output;
    }


    /**
    * @dev Minting function
    * @param tokenId token id
    */
    function claim(uint256 tokenId) public payable nonReentrant {
        require(tokenId >= 0 && tokenId < 1440, "Token ID invalid");
        require(msg.value >= salePrice, "Not enough fund");
        _safeMint(_msgSender(), tokenId);
        uint256 ethersVal = block.timestamp + (msg.value / 10**18) * 1 days;
        releaseDetails[tokenId] = NFTDetails(msg.value,ethersVal);
    }

        function pause() public onlyOwner {
        _pause();
    }

    function unpause() public onlyOwner {
        _unpause();
    }

    function _beforeTokenTransfer(address from, address to, uint256 tokenId)
        internal
        whenNotPaused
        override
    {
        super._beforeTokenTransfer(from, to, tokenId);
    }

    /**
    * @dev NFT holders can withdraw all their fund using this function
    * @param _tokenId sender should be owner of this token
    * @return bool if user successfullt withdraw
    */
    function withdrawNFT(uint256 _tokenId) external payable returns(bool){
        require(_tokenId >= 0 && _tokenId < 1440, "Token ID invalid");
        require(ownerOf(_tokenId) == msg.sender, "You are not the owner of this NFT");
        require(releaseDetails[_tokenId].lockedAmount > 0 && releaseDetails[_tokenId].releaseDate > 0, "Invalid user");
        require(block.timestamp > releaseDetails[_tokenId].releaseDate, "Too early to receive funds");
        uint256 value = releaseDetails[_tokenId].lockedAmount;
        releaseDetails[_tokenId].lockedAmount = 0;
        releaseDetails[_tokenId].releaseDate = 0;

        payable(msg.sender).transfer(value);

        return true;
    }



    constructor(uint256 _price) ERC721OwnerCheck("Day ZERO", "TIME") Ownable() {
        salePrice = _price;
    }
}

